import React from 'react';
import { useSelector } from 'react-redux';


adminProductList = useSelector((state) => state.adminProductList);
const { products } = adminProductList;

const headers = [
	{ label: 'Product Name', key: 'product' },
	{ label: 'Serial Number', key: 'serial' },
	{ label: 'Batch No', key: 'batch_no' },
	{ label: 'Pin Code', key: 'pin_code' },
	{ label: 'QR Code', key: 'QRcode' }
];

const csvReport = {
	data: products,
	headers: headers,
	filename: 'Products.csv'
};

export default csvReport;
